import React, {Component} from 'react';
import "./assets/css/style.css"
import StartAnimation from "./components/animateComponent/StartAnimation";


class App extends Component {

    render() {
        const style = {
            backgroundColor: "blue",
            textAlign: "center",
            width: "100%",
            height: "200px",
            fontSize: "4em",
        };

        return (
            <Spring
                from={{ opacity: 0,
                    marginTop: "-50%"}}
                to={{ opacity: 1,
                    marginTop: "0px"}}
                delay='500'>
                {props => <div style={props}>
                    <div className="box" style={style}>
                        Hello
                    </div>
                </div>}
            </Spring>
        );
    }
}
